import React from "react";
import { View, Text } from "react-native";
import { FormS } from "./components/svm";
import stylescards from "../../styles/cards";
import { StatusBar } from "expo-status-bar";
import form from "../../styles/form";
import { Form } from "formik";


export function DetectionScreen2(){
    return(
        <View style={{ flex: 1, backgroundColor: '#FFFFFF' }}>
            <StatusBar backgroundColor='#1e90ff' barStyle="light-content"></StatusBar>
            <Text style={form.title}>Detecci√≥n con el Modelo SVM</Text>
            <FormS></FormS>
        </View>
    )
}
